@jeriann Our apologies for the frustration you're feeling.
It looks like you were corresponding with Juliet, our digital travel assistant (chatbot).
You can connect to an agent by signing in to a Facebook account, choosing "Agent" and then "Chat with a specialist."

@Fakechrismorgan Our apologies for the difficulties.
We don't have a way to speed this up.
If they need WestJet's help, ask them to call our Travel Support Team.

@JoshuaKnaak We're sorry to hear that.
We trust you were able to speak with a member of our cabin crew on board.
If you need our help, please send us a direct message. https://t.co/o7MlHGd5Wh
